  return <div>
    <header>
      {/* <Aboutus/> */}
    <div className='logo'>
        <img src="/images/chef-icon.png" width={100} alt="chef illustration"/>
    </div>
    <ul  className='header-menu'>
        <li className='li'> <Link to="/" style={linkstyle.Linkstyleup  }>Home</Link></li>
